export default class UserModel extends Model<UserModel> {
  @PrimaryKey
  @Unique
  @Column(DataType.INTEGER)
  id: number;

  @Column(DataType.STRING)
  login: string;

  @Column(DataType.STRING)
  password: string;

  @Default(false)
  @Column(DataType.BOOLEAN)
  isAdmin: boolean;
}

