import express from 'express';
import UserService from "../services/userService";
import { validateUser } from "../models/userValidation";

const userRouter = express.Router();

userRouter.get('/', async (req, res) => {
  try {
    const { loginSubstring = '', limit = 10 } = req.query;
    const users = await UserService.getAllUsers(loginSubstring as string);

    if (!users.length) {
      return res.status(200).send('There are no users');
    }

    return res.status(200).json(users);
  } catch (err) {
    res.status(500).json({ error: err.message });
  }
});

userRouter.get('/:id', async (req, res) => {
  try {
    const user = await UserService.getUserById(req.params.id);

    user
      ? res.status(200).json(user)
      : res.status(404).json({ message: 'User not found' });
  } catch (err) {
    res.status(500).json({ message: err.message });
  }
});

userRouter.post('/', validateUser(), async (req, res) => {
  const user = req.body;
  try {
    const addedUser = await UserService.addUser(user);
    return res.status(201).json(addedUser);
  } catch (err) {
    res.status(500).json({ mesage: err.mesage });
  }
});

userRouter.put('/:id', validateUser(), async (req, res) => {
  const updatedUser = req.body;
  try {
    const user = await UserService.updateUser(updatedUser, req.params.id);
    if (!user) return res.status(404).json({ mesage: 'User not found' });
    return res.status(200).json(user);
  } catch (err) {
    res.status(500).json({ mesage: err.mesage });
  }
});

